import './App.css';
import Weather from "./Weather";

export default function App() {

  return (
    <div className="App">
<div className="container">
<Weather defaultCity="London" />
<br />
        <footer>
          This project was coded by <a href="https://www.alineclaudio.com" target="_blank" rel="noreferrer"> Aline Claudio</a> and is open-sourced on <a href="https://github.com/alineolic/react-weather-app-new2" target="_blank" rel="noreferrer">GitHub</a> and hosted on <a href="https://app.netlify.com/" target="_blank" rel="noreferrer">Netlify</a>.
        </footer>
</div>
    </div>
  );
}
